import React, { Component } from 'react'

export default class Timer extends Component {
  render() {
    return (
      <div className="timer">
      <br/>
      <span className="count-down" onClick={this.timer}>
      {this.props.currentTime}</span>
      <br/>
      <span>Current Cycle</span> 
      </div>
    )
  }
}
